import{_ as i,o as t,c as a,N as e}from"./chunks/framework.7e203a6d.js";const o="/assets/1.6c4eade4.jpg",l="/assets/2.caf66a0e.jpg",f=JSON.parse('{"title":"Adding AOI visibility data","description":"","frontmatter":{},"headers":[],"relativePath":"basic/aoi-visibility.md"}'),d={name:"basic/aoi-visibility.md"},s=e('<h1 id="adding-aoi-visibility-data" tabindex="-1">Adding AOI visibility data <a class="header-anchor" href="#adding-aoi-visibility-data" aria-label="Permalink to &quot;Adding AOI visibility data&quot;">​</a></h1><p>GazePlotter supports the upload of AOI visibility data, allowing for the effective visualization of dynamic AOIs and their visibility in the stimulus. This enhances interpretability of the data and allows for more detailed analysis.</p><h2 id="getting-aoi-visibility-data" tabindex="-1">Getting AOI visibility data <a class="header-anchor" href="#getting-aoi-visibility-data" aria-label="Permalink to &quot;Getting AOI visibility data&quot;">​</a></h2><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This feature is available only for <a href="/upload-data/smi-begaze.html">SMI BeGaze</a> software export.</p></div><h3 id="from-smi-begaze" tabindex="-1">From SMI BeGaze <a class="header-anchor" href="#from-smi-begaze" aria-label="Permalink to &quot;From SMI BeGaze&quot;">​</a></h3><p>In the SMI BeGaze software, open <code>AOI Editor</code>. Export the AOI visibility data as <code>.xml</code> file by clicking <code>Save</code> button. In this file, you can find the information about the visibility of each AOI in a given stimulus.</p><p>The exported file can be then simply added to the workplace to already uploaded <a href="/upload-data/smi-begaze.html">SMI BeGaze</a> data, see below.</p><h2 id="adding-aoi-visibility-data-to-the-workplace" tabindex="-1">Adding AOI visibility data to the workplace <a class="header-anchor" href="#adding-aoi-visibility-data-to-the-workplace" aria-label="Permalink to &quot;Adding AOI visibility data to the workplace&quot;">​</a></h2><p>To add AOI visibility data to the workplace:</p><ol><li>Click <code>Settings</code> button in the top right corner of the scarf plot with desired stimulus set.</li><li>In the <code>Scarf Chart Settings</code> window, click <code>AOIs visibility</code> button.</li><li>In new window, select the <code>.xml</code> file with AOI visibility data.</li><li>Select whether to add the AOI visibility data to all participants or only to the selected one.</li><li>Click <code>Start parsing</code> button. The AOI visibility data will be added to the workplace.</li></ol><p><img src="'+o+'" alt=""></p><h2 id="interactivity" tabindex="-1">Interactivity <a class="header-anchor" href="#interactivity" aria-label="Permalink to &quot;Interactivity&quot;">​</a></h2><p>Each AOI visibility data is represented by a colored line. This is expanded and thus highlighted when the mouse is moved over the corresponding AOI category in the legend.</p><p><img src="'+l+'" alt=""></p>',14),n=[s];function r(c,h,p,b,y,m){return t(),a("div",null,n)}const u=i(d,[["render",r]]);export{f as __pageData,u as default};
